import React, {useState} from "react";

function callAPI() {
    
}

function App() {

    const [response, setState] = useState({
        apiResponse: ""
    });

    fetch("http://localhost:9000/Websites")
        .then(res => res.text())
        .then(res => this.setState({apiResponse: res}))
        .catch(err => err);

    return <div>
        <h1>Hello App {response.apiResponse} </h1>
    </div>
}

export default App;
